import React,{useState,useEffect} from 'react'
import Button from '@material-ui/core/Button'
import '../../styles/BandeauTop.css';

const BoutonAction = ({
    action,
    nb
}) => {
    

    return (  
        <Button variant="contained" disableElevation>
            <div  className="bouton-action">
                <span class="title-action">{action+"\n"}</span>

                {nb>1 ? 
                <i>{nb+" interventions"}</i>

                :

                <i>{nb+" intervention"}</i>
                }
            </div>
            
        </Button>
            
       

    );
}
 
export default BoutonAction;
